        sb.append(", modifyFinanceAmount=").append(modifyFinanceAmount);
        sb.append(", modifyFinanceTerm=").append(modifyFinanceTerm);
        sb.append(", modifyComment=").append(modifyComment);
        sb.append(", modifyStatus=").append(modifyStatus);
